interface State {
    user: any[]; // Coloca el tipo correcto para el array de usuarios
  }

  // Definir el tipo para las acciones
  type Action = {
    type: string;
    payload?: any; // Coloca el tipo correcto para el payload si es necesario
  };

const initialState: State = {
    user : [],
};

const rootReducer = (state = initialState, action: Action) => {
    switch(action.type){
        default: return { ...state };
    }
};

export default rootReducer;
